# [1416] Restore The Array
#

# @lc code=start

from functools import cache

class Solution:
    def numberOfArrays(self, s: str, k: int) -> int:
        for i in reversed(range(len(s))):
            self.solve(s, i, k)
        return self.solve(s, 0, k)

    @cache
    def solve(self, s: str, start: int, k: int) -> int:
        # print(s, k)
        if s[start] == '0':
            return 0
        poss = 0
        if len(s) - start < 4300 and int(s[start:]) <= k:
            poss += 1
            poss %= 1000000007
        ks = str(k)
        for i in range(start + 1, min(len(s), start + len(ks) + 1)):
            l = s[start:i]
            if int(l) <= k:
                poss += self.solve(s, i, k)
                poss %= 1000000007
            else:
                break
        return poss
# @lc code=end

from test_utils import run_test

def test(s: str, k: int) -> int:
    return Solution().numberOfArrays(s, k)

method = test

run_test(method, ['1111111111111', 1000000000], 4076)
